      SELECT ALL + 31 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 23 * + - col2 NOT BETWEEN NULL AND ( - col0 + col0 + + + 70 * - 75 + col2 + + - col2 );
  - name: tab1

outputs:
  - name: q10956.out
    data: |
